    value, value1, value2 = [],[],[]
    for i in products_info['body']['products']:
        counter = 0
        for g in i['propertiesPortion']:
            if counter == 0: value = g['value']
            if counter == 1: value1 = g['value']
            if counter == 2: value2 = g['value']
            counter += 1
        result = collection.insert_one({'_id': i['productId'], 'Name': i['name'], 'Diagonal/resolution': value, 'CPU': value1, 'RAM': value2})
        print(result)
